(20, 'http://127.0.0.1/middleware/demoItems.rdf#i1259333781031385400', 'http://www.tao.lu/Ontologies/TAOItem.rdf#ItemContent', '<?xml version=''1.0'' encoding=''UTF-8'' ?>\r\n<tao:ITEM xmlns:rdf=''http://www.w3.org/1999/02/22-rdf-syntax-ns#'' rdf:ID="http://127.0.0.1/middleware/demoItems.rdf#125181722819962" xmlns:tao=''http://www.tao.lu/tao.rdfs#''\r\n xmlns:rdfs=''http://www.w3.org/TR/1999/PR-rdf-schema-19990303#''>\r\n<rdfs:LABEL lang="EN">myItem\r\n</rdfs:LABEL>\r\n<rdfs:COMMENT lang="EN">my created item\r\n</rdfs:COMMENT>\r\n\r\n<tao:DISPLAYALLINQUIRIES></tao:DISPLAYALLINQUIRIES>\r\n\r\n<tao:DURATION></tao:DURATION>\r\n\r\n				<tao:ITEMPRESENTATION>\r\n						<xul>\r\n							<stylesheet id="item_stylesheet" src="./item.css"/>\r\n							<box id="itemContainer_box" class="item">\r\n								\r\n								<textbox id="problem_textbox" left="0" top="0" width="800" height="600" multiline="true" wrap="true" readonly="true" value="problematique&lt;br /&gt;"/>\r\n								<button id="prevInquiry_button" left="45" top="88" label="&lt;" image="inquiry_previous.jpg" url="http://www.tao.lu/middleware/itempics/default/left.swf" disabled="true" oncommand="tao_item.prevInquiry"/>\r\n								<button id="nextInquiry_button" left="100" top="88" label="&gt;" image="inquiry_next.jpg" url="http://www.tao.lu/middleware/itempics/default/right.swf" disabled="true" oncommand="tao_item.nextInquiry"/>\r\n							   <!--<progressmeter id="item_progressmeter" left="160" top="88" mode="determined" value="0"/>-->\r\n								<box id="inquiryContainer_box" left="5" top="100"/>\r\n								\r\n							</box>\r\n						</xul>\r\n					</tao:ITEMPRESENTATION>\r\n			\r\n<tao:ITEMLISTENERS></tao:ITEMLISTENERS><tao:PROBLEM lang="EN" type="String">problematique&lt;br /&gt;</tao:PROBLEM><tao:INQUIRY order="1"><tao:QUESTION lang="EN" type="String">Question 1&lt;br /&gt;</tao:QUESTION>\r\n			<tao:INQUIRYDESCRIPTION><tao:PROPOSITIONTYPE>Multiple Choice</tao:PROPOSITIONTYPE>\r\n			<tao:WIDGET>FLASH Check Button</tao:WIDGET>\r\n			<tao:PROPLISTENERS><tao:ITEMBEHAVIOR tao:LISTENERNAME="Answered : Question 1&lt;br /&gt; #{XPATH(/tao:ITEM/tao:INQUIRY[@order=1]/tao:INQUIRYDESCRIPTION/tao:LISTPROPOSITION/tao:PROPOSITION[@order=1])}#" src="#{XPATH(/tao:ITEM/tao:INQUIRY[@order=1]/tao:INQUIRYDESCRIPTION/tao:HASPRESENTATIONLAYER/xul/box/box/checkbox[@id=proposition_1_checkbox])}#"/></tao:PROPLISTENERS>\r\n			<tao:ANSWERTYPE>Exclusive Vector</tao:ANSWERTYPE>\r\n			<tao:EVALUATIONRULE>AND.swf</tao:EVALUATIONRULE>\r\n			<tao:HASGUIDE>technicalID.hlp</tao:HASGUIDE>\r\n			\r\n			<tao:HASPRESENTATIONLAYER><xul>\r\n                    <box id="inquiryContainer_box" left="0" top="0">\r\n					<textbox id="question_textbox" wrap="true" style="borderStyle:none" readonly="true" width="700" height="45" left="50" top="100" class="question" value="Question 1&lt;br /&gt;" />\r\n            			\r\n						<box id="propositions_box" left="10" top="13">\r\n                        \r\n								<checkbox id="proposition_1_checkbox" left="10" top="100" width="1000" selected="false" label="Question 2"></checkbox></box>\r\n                       \r\n                    </box>\r\n					\r\n                </xul></tao:HASPRESENTATIONLAYER>\r\n			\r\n			\r\n			<tao:LISTPROPOSITION><tao:PROPOSITION lang="EN" type="String" Id="1" order="1" answer="0">Question 2</tao:PROPOSITION></tao:LISTPROPOSITION>\r\n			<tao:HASANSWER>0</tao:HASANSWER>\r\n			</tao:INQUIRYDESCRIPTION>\r\n			</tao:INQUIRY><tao:INQUIRY order="2"><tao:QUESTION lang="EN" type="String">Â \r\nquestion 2?&lt;br /&gt;</tao:QUESTION>\r\n			<tao:INQUIRYDESCRIPTION><tao:PROPOSITIONTYPE>Multiple Choice</tao:PROPOSITIONTYPE>\r\n			<tao:WIDGET>FLASH Check Button</tao:WIDGET>\r\n			<tao:PROPLISTENERS><tao:ITEMBEHAVIOR tao:LISTENERNAME="Answered : Â \r\nquestion 2?&lt;br /&gt; #{XPATH(/tao:ITEM/tao:INQUIRY[@order=2]/tao:INQUIRYDESCRIPTION/tao:LISTPROPOSITION/tao:PROPOSITION[@order=1])}#" src="#{XPATH(/tao:ITEM/tao:INQUIRY[@order=2]/tao:INQUIRYDESCRIPTION/tao:HASPRESENTATIONLAYER/xul/box/box/checkbox[@id=proposition_1_checkbox])}#"/><tao:ITEMBEHAVIOR tao:LISTENERNAME="Answered : Â \r\nquestion 2?&lt;br /&gt; #{XPATH(/tao:ITEM/tao:INQUIRY[@order=2]/tao:INQUIRYDESCRIPTION/tao:LISTPROPOSITION/tao:PROPOSITION[@order=2])}#" src="#{XPATH(/tao:ITEM/tao:INQUIRY[@order=2]/tao:INQUIRYDESCRIPTION/tao:HASPRESENTATIONLAYER/xul/box/box/checkbox[@id=proposition_2_checkbox])}#"/></tao:PROPLISTENERS>\r\n			<tao:ANSWERTYPE>Exclusive Vector</tao:ANSWERTYPE>\r\n			<tao:EVALUATIONRULE>AND.swf</tao:EVALUATIONRULE>\r\n			<tao:HASGUIDE>technicalID.hlp</tao:HASGUIDE>\r\n			\r\n			<tao:HASPRESENTATIONLAYER><xul>\r\n                    <box id="inquiryContainer_box" left="0" top="0">\r\n					<textbox id="question_textbox" wrap="true" style="borderStyle:none" readonly="true" width="700" height="45" left="0" top="0" class="question" value="Â \r\nquestion 2?&lt;br /&gt;" />\r\n            			\r\n						<box id="propositions_box" left="10" top="13">\r\n                        \r\n								<checkbox id="proposition_1_checkbox" left="5" top="0" width="1000" selected="false" label="oui"></checkbox>\r\n								<checkbox id="proposition_2_checkbox" left="5" top="10" width="1000" selected="false" label="non"></checkbox></box>\r\n                       \r\n                    </box>\r\n					\r\n                </xul></tao:HASPRESENTATIONLAYER>\r\n			\r\n			\r\n			<tao:LISTPROPOSITION><tao:PROPOSITION lang="EN" type="String" Id="1" order="1" answer="0">oui</tao:PROPOSITION><tao:PROPOSITION lang="EN" type="String" Id="2" order="2" answer="0">non</tao:PROPOSITION></tao:LISTPROPOSITION>\r\n			<tao:HASANSWER>00</tao:HASANSWER>\r\n			</tao:INQUIRYDESCRIPTION>\r\n			</tao:INQUIRY></tao:ITEM>', '', 'demo', 'yyy[admin,administrators,authors]', 'yyy[admin,administrators,authors]', 'yyy[admin,administrators,authors]', '2009-11-27 18:06:25'),
